def get_PMmetrics_1( yeartoPull, numberOfMonths, unitsOfMeasurment, metricNames, metrictopull, propertyID):
	b = 0
	l = range(0,len(metrictopull))
	metricpulled = pd.DataFrame()
	metricpulled['PropertyID'] = [propertyID]
	while b < len(metrictopull):
		t = metrictopull[b:9+b]
		y = ', '.join(t)
		print (propertyID)
		try:
			roottemp =  ES_Client.get_metrics(propertyID, yeartoPull, numberOfMonths, unitsOfMeasurment, y).text
			root = Et.fromstring(roottemp.encode('utf-8'))
			for child in root.findall('metric'):
				nameofmetric = child.get('name')
				value =  child.find('value').text
				if nameofmetric == "defaultDataFlagInPropertyUses" and value == None:
					value = "No"
				metricpulled[nameofmetric] = value
		except:
			try:
				sleep(2)
				roottemp =  ES_Client.get_metrics(propertyID, yeartoPull, numberOfMonths, unitsOfMeasurment, y).text
				root = Et.fromstring(roottemp.encode('utf-8'))
				for child in root.findall('metric'):
					nameofmetric = child.get('name')
					value =  child.find('value').text
					if nameofmetric == "defaultDataFlagInPropertyUses" and value == None:
						value = "No"
					metricpulled[nameofmetric] = value
			except:
				pass
		b += 9	
	metricpulled.set_index('PropertyID',inplace = True)
	return metricpulled

